"""Here the example basically use binary search:return number type dynamic dataNot support string data here."""def search(items, value):    for item in range(len(items)):        if items[item] == value:            return f"Found {value}"    return f"Sorry! not found {value}"items = [1, 2, 3, 4, 5]user_input = int(input("Search number: "))result = search(items, user_input)print(str(result))